    "2015-09-26T19:56:09.191348",nt"name": "1961-american-samoa-historical-scanned-imagery",nt"isopen":
    false,nt"url": null,nt"notes": "These images are part of a project funded
    by NOAA Office for Coastal Management to develop a high quality, user-friendly,
    attributed, centralized, multi-territorial digital database of georeferenced historic
    aerial imagery in the Pacific Islands region, including Hawaii, American Samoa,
    Guam, and the Commonwealth of the Northern Mariana Islands. The objective of this
    project is to make previously unavailable historic aerial imagery of the Pacific
    Islands available for public consumption through NOAA's Digital Coast website. These
    images were scanned on a flatbed scanner and georeferenced to existing basemap data.",nt"license_title":
